import React from "react";

const user = props => (
  <div>
    <h1>Name: {props.name}</h1>
    <p>Age: {props.age}</p>
    <style jsx>{`
      div {
        boder: 1px solid #eee;
        box-shadow: 0 2px 3px #eee;
        padding: 20px;
        text-alignc: center;
      }
    `}</style>
  </div>
);

export default user;
